import React from 'react';
import ReactMapGL, { Marker } from 'react-map-gl';
import { useSelector, useDispatch } from 'react-redux';

import { selectDataCorona } from '../../redux/data/data.selectors';

import { CircleContainer } from './circle.style';

const Circle = () => {
	const dataCorona = useSelector(selectDataCorona);
	console.log(dataCorona);
	return (
		<ReactMapGL mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}>
			{dataCorona.map(({ coordinates, confirmed }, i) => (
				<Marker
					key={i}
					latitude={coordinates[0]}
					longitude={coordinates[1]}
				>
					<CircleContainer />
				</Marker>
			))}
		</ReactMapGL>
	);
};

export default Circle;
